import React from 'react';
import { Link } from 'react-router-dom';
import './header.css';
import barritaImage from '../Imagenes/barritaImage.png';

const Header = () => {
  return (
    <header className="header">
      <img src={barritaImage} alt="Barrita Romulo" className="barrita-image" />

      <div className="collapse" id="navbarToggleExternalContent" data-bs-theme="dark">
        <div className="bg-dark p-4">
          <h5 className="text-body-emphasis h4">Collapsed content</h5>
          <span className="text-body-secondary">Toggleable via the navbar brand.</span>
        </div>
      </div>

      <nav className="navbar navbar-dark bg-dark">
        <div className="container-fluid">
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarToggleExternalContent" aria-controls="navbarToggleExternalContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
        </div>
      </nav>

      <nav>
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/catalogo">Catalogo</Link></li>
          <li><Link to="/promocion">Promociones</Link></li>
          <li><Link to="/favoritos">Favoritos</Link></li>
          <li><Link to="/carrito">Carrito</Link></li>
          <li><Link to="/login">Login/Registro</Link></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
